"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vancomycin-resistant enterococci (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vancomycin-resistant-enterococci-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H10195180\">",
"      <span class=\"h1\">",
"       What are vancomycin-resistant enterococci (VRE)?",
"      </span>",
"      &nbsp;&mdash;&nbsp;",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?17/34/17957?source=see_link\">",
"       Vancomycin",
"      </a>",
"      -resistant enterococci",
"      <strong>",
"      </strong>",
"      (also called &ldquo;VRE&rdquo;) are bacteria that cause an infection that is hard to cure. Enterococci are a kind of bacteria. Vancomycin is an antibiotic used to treat infections caused by enterococci. But some enterococci have learned to outsmart the medicines that doctors normally use to kill them. Doctors call this &ldquo;resistance.&rdquo;",
"     </p>",
"     <p>",
"      People carry all sorts of germs inside their body and on their skin. The body usually controls these germs, so they do no harm. Enterrococci are normally found in the intestines and the female sex organs. They are also found on surfaces in living spaces, especially bathrooms.",
"     </p>",
"     <p>",
"      Some people have VRE inside their bodies but do not get an infection. Doctors describe these people as having &ldquo;VRE colonization.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195195\">",
"      <span class=\"h1\">",
"       How do you catch VRE?",
"      </span>",
"      &nbsp;&mdash;&nbsp;VRE are common in hospitals and nursing homes. In these places, VRE have been found on bedrails, telephones, and medical equipment.",
"     </p>",
"     <p>",
"      VRE is spread through touch. Often, it is spread by the hands of a person (usually a doctor, nurse, or caregiver) who has touched someone or something with VRE. People can also catch VRE by touching a surface with VRE on it. VRE is not spread by coughing or sneezing.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195210\">",
"      <span class=\"h1\">",
"       How do I know if I have a VRE infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;VRE can cause infections of the urinary tract (the organs that process urine), in the belly, or in the bloodstream. If your doctor suspects you have a VRE infection, he or she will do tests to check for VRE in your urine or blood. You might also need an imaging test, such a CT scan, that takes pictures of the inside of your body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195225\">",
"      <span class=\"h1\">",
"       Can VRE infections be treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor can give you special antibiotics to treat your infection. The antibiotics can be given as pills or through a tube in one of your veins. This tube is called an &ldquo;IV.&rdquo;",
"     </p>",
"     <p>",
"      If you get medicines to take at home, it is very important that you follow the directions exactly. Take",
"      <strong>",
"       ALL",
"      </strong>",
"      &nbsp;the pills you are given, even if you feel better before you finish them. If you do not take them all, the bacteria could get resistance to the medicine you are taking.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195240\">",
"      <span class=\"h1\">",
"       Is there any way to prevent VRE colonization and infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People everywhere should wash their hands often with soap and water. This is especially important for people who are in the hospital or a nursing home. Washing your hands is the best way to prevent most infections.",
"     </p>",
"     <p>",
"      If you are a patient in a hospital, you should also make sure your doctors and nurses wash their&nbsp;hands before they touch you. If there is no sink, they can use an alcohol-based hand gel instead.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195255\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?19/47/20210?source=see_link\">",
"       Patient information: Urinary tract infections in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?25/48/26370?source=see_link\">",
