var title_f38_19_39224="Life cycle African trypanosomiasis";
var content_f38_19_39224=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F85844&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F85844&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 631px\">",
"   <div class=\"ttl\">",
"    Life cycle African trypanosomiasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 611px; height: 445px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    During a blood meal on the mammalian host, an infected tsetse fly (genus",
"    <em>",
"     Glossina",
"    </em>",
"    ) injects metacyclic trypomastigotes into skin tissue. The parasites enter the lymphatic system and pass into the bloodstream",
"    <strong>",
"     (1)",
"    </strong>",
"    . Inside the host, they transform into bloodstream trypomastigotes",
"    <strong>",
"     (2)",
"    </strong>",
"    , are carried to other sites throughout the body, reach other blood fluids (eg, lymph, spinal fluid), and continue the replication by binary fission",
"    <strong>",
"     (3)",
"    </strong>",
"    . The entire life cycle of African Trypanosomes is represented by extracellular stages. The tsetse fly becomes infected with bloodstream trypomastigotes when taking a blood meal on an infected mammalian host",
"    <strong>",
"     (4,5)",
"    </strong>",
"    . In the fly's midgut, the parasites transform into procyclic trypomastigotes, multiply by binary fission",
"    <strong>",
"     (6)",
"    </strong>",
"    , leave the midgut, and transform into epimastigotes",
"    <strong>",
"     (7)",
"    </strong>",
"    . The epimastigotes reach the fly's salivary glands and continue multiplication by binary fission",
"    <strong>",
"     (8)",
"    </strong>",
"    . The cycle in the fly takes approximately three weeks. Humans are the main reservoir for",
"    <em>",
"     Trypanosoma brucei gambiense",
"    </em>",
"    , but this species can also be found in animals. Wild game animals are the main reservoir of",
"    <em>",
"     T. b. rhodesiense",
"    </em>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers of Disease Control and Prevention. Parasites and Health: Trypanosomiasis, African. Available at:",
"     <a href=\"file://dpd.cdc.gov/dpdx/html/TrypanosomiasisAfrican.htm\" target=\"_blank\">",
"      file://dpd.cdc.gov/dpdx/html/TrypanosomiasisAfrican.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
