var title_f38_19_39227="BIRADS mammography categories";
var content_f38_19_39227=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F66601&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F66601&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    BI-RADS mammographic assessment categories",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Assessment category",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommendation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Probability of malignancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0: Incomplete",
"       </td>",
"       <td>",
"        Need for further evaluation",
"       </td>",
"       <td>",
"        Not applicable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1: Normal",
"       </td>",
"       <td>",
"        Normal interval follow-up",
"       </td>",
"       <td>",
"        0 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2: Benign",
"       </td>",
"       <td>",
"        Normal interval follow-up",
"       </td>",
"       <td>",
"        0 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3: Probably benign",
"       </td>",
"       <td>",
"        A short interval follow-up is recommended",
"       </td>",
"       <td>",
"        &lt;2 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        4: Suspicious abnormality",
"       </td>",
"       <td rowspan=\"4\">",
"        A biopsy should be considered",
"       </td>",
"       <td class=\"sublist1_start\">",
"        &ge;2 to &lt;95 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        (a) Low-risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        (b) Intermediate-risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        (c) Moderate to high-risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5: Highly suggestive of malignancy",
"       </td>",
"       <td>",
"        Biopsy or surgery should be performed",
"       </td>",
"       <td>",
"        &ge;95 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6: Biopsy-proven carcinoma",
"       </td>",
"       <td>",
"        Appropriate action should be taken",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     BI-RADS: Breast Imaging Reporting and Data System.",
"    </div>",
"    <div class=\"reference\">",
"     Source: Breast Imaging Reporting and Data System (BI-RADS) Atlas. 4th Edition. American College of Radiology, Reston, VA, 2003",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
