var title_f38_19_39228="Etiology of nasal obstruction";
var content_f38_19_39228=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F79359&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F79359&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Etiology of nasal obstruction",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Mucosal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Inflammatory",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rhinosinusitis (may also have infectious etiology)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rhinitis, allergic and non-allergic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nasal polyps",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        granulomatosis with polyangiitis (Wegener's)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sarcoidosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Histiocytosis X",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Infectious",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        HIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Syphilis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tuberculosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nasal vestibulitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Medication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antithyroid medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Antihypertensive medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Alpha-blockers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Angiotensin converting enzyme (ACE) inhibitors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Beta-blockers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Calcium channel blockers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Hydralazine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Some antidepressants",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benzodiazepines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Erectile dysfunction agents (Phosphodiesterase 5-inhibitors)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Estrogen and progesterone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nonsteroidal anti-inflammatory drugs (NSAIDs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rhinitis medicamentosa (rebound nasal congestion with intranasal decongestants such as oxymetazoline or neosynephrine)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Structural",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Congenital abnormalities",
"        </strong>",
"        (eg, pyriform aperture stenosis, choanal atresia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Acquired abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Enlarged adenoids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Foreign bodies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Septal disorders (eg, septal perforation due to intranasal cocaine, septal deviation due to trauma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nasal valve abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mucoceles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Tumors",
"        </strong>",
"        (eg, inverted papilloma, squamous cell carcinoma, adenoid cystic carcinoma, olfactory neuroblastoma)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
